import React, { useState } from 'react';
import { 
  Container, Typography, Paper, TextField, Button, 
  Box, CircularProgress, Chip, Divider
} from '@mui/material';
import { styled } from '@mui/material/styles';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import AnalyzeIcon from '@mui/icons-material/Analytics';
import PictureAsPdfIcon from '@mui/icons-material/PictureAsPdf';
import DescriptionIcon from '@mui/icons-material/Description';

const VisuallyHiddenInput = styled('input')({
  clip: 'rect(0 0 0 0)',
  clipPath: 'inset(50%)',
  height: 1,
  overflow: 'hidden',
  position: 'absolute',
  bottom: 0,
  left: 0,
  whiteSpace: 'nowrap',
  width: 1,
});

const TitleBox = styled(Box)(({ theme }) => ({
  background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
  color: 'white',
  padding: theme.spacing(2),
  borderRadius: theme.shape.borderRadius,
  marginBottom: theme.spacing(3),
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
}));

const Title = styled(Typography)(({ theme }) => ({
  fontWeight: 700,
  letterSpacing: '0.5px',
  marginLeft: theme.spacing(1),
}));

const Subtitle = styled(Typography)(({ theme }) => ({
  fontWeight: 300,
  opacity: 0.8,
  marginTop: theme.spacing(1),
}));

function App() {
  const [file, setFile] = useState(null);
  const [prompt, setPrompt] = useState('');
  const [results, setResults] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    if (selectedFile && (selectedFile.type === 'application/pdf' || selectedFile.type === 'application/vnd.openxmlformats-officedocument.wordprocessingml.document')) {
      setFile(selectedFile);
    } else {
      alert('Please upload a PDF or Word document');
      setFile(null);
    }
  };

  const handleAnalyze = async () => {
    if (!file || !prompt) {
      alert('Please upload a file and enter a prompt');
      return;
    }
    setIsLoading(true);
    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('prompt', prompt);

      const response = await fetch('http://localhost:3003/analyze', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setResults(data.analysis);
    } catch (error) {
      console.error('Error during analysis:', error);
      setResults('An error occurred during analysis: ' + error.message);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <Container maxWidth="md">
      <TitleBox>
        <DescriptionIcon fontSize="large" />
        <Box>
          <Title variant="h4" component="h1">
            Resume Analyzer
          </Title>
          <Subtitle variant="subtitle1">
            AI-powered insights in minutes
          </Subtitle>
        </Box>
      </TitleBox>

      <Paper elevation={3} sx={{ p: 3, mb: 3 }}>
        <TextField
          fullWidth
          multiline
          rows={4}
          variant="outlined"
          label="Enter your analysis prompt"
          value={prompt}
          onChange={(e) => setPrompt(e.target.value)}
          sx={{ mb: 2 }}
        />
        <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
          <Button
            component="label"
            variant="contained"
            startIcon={<CloudUploadIcon />}
          >
            Upload Resume
            <VisuallyHiddenInput type="file" onChange={handleFileChange} accept=".pdf,.docx" />
          </Button>
          <Button
            variant="contained"
            color="primary"
            onClick={handleAnalyze}
            disabled={!file || !prompt || isLoading}
            startIcon={isLoading ? <CircularProgress size={24} /> : <AnalyzeIcon />}
          >
            {isLoading ? 'Analyzing...' : 'Analyze Resume'}
          </Button>
        </Box>
        {file && (
          <Chip
            icon={file.type === 'application/pdf' ? <PictureAsPdfIcon /> : <DescriptionIcon />}
            label={file.name}
            onDelete={() => setFile(null)}
            sx={{ mb: 1 }}
          />
        )}
        <Typography variant="body2">
          Supported file types: PDF, Word (.docx)
        </Typography>
      </Paper>

      {results && (
        <Paper elevation={3} sx={{ p: 3 }}>
          <Typography variant="h5" gutterBottom>
            Analysis Results
          </Typography>
          <Divider sx={{ mb: 2 }} />
          <Typography variant="body1" component="pre" sx={{ whiteSpace: 'pre-wrap' }}>
            {results}
          </Typography>
        </Paper>
      )}
    </Container>
  );
}

export default App;
